CREATE TABLE CPU(
   id          INTEGER  NOT NULL PRIMARY KEY 
  ,name        VARCHAR(49) NOT NULL
  ,price       NUMERIC(7,2)
  ,core_count  INTEGER  NOT NULL
  ,core_clock  NUMERIC(5,3) NOT NULL
  ,boost_clock NUMERIC(3,1)
  ,tdp         INTEGER  NOT NULL
  ,graphics    VARCHAR(23)
  ,smt         VARCHAR(5) NOT NULL
);
